INSERT INTO `day` VALUES (1,'Republic Day','',NULL,NULL,6,'','The Republic Day of India is a national holiday of India to mark the adoption of the Constitution of India and the transition of India from a British Dominion to a republic on January 26, 1950. It is one of the three national holidays in India.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(2,'Maha Shivratri','',NULL,NULL,6,'','Maha Shivratri, the night of the worship of Lord Shiva, occurs on the 14th night of the new moon during the dark half of the month of Phalguna. It falls on a moonless February night, when Hindus offer special prayer to the lord of destruction.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(3,'Holi','',NULL,NULL,6,'','Holi, also known as Dhuli Vandana in Sanskrit,also Dhulheti, Dhulandi or Dhulendi, is celebrated by people throwing coloured powder and coloured water at each other.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(4,'Mahavir Jayanti','',NULL,NULL,6,'','In Jainism, Mahavir Jayanti is the most important religious holiday. It celebrates the birth of Mahavira, the last Tirthankara. He was born on the 13th day of the rising moon of Chaitra, in either 599 BC or 615 BC (depending on religious tradition).','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(5,'Good Friday','',NULL,NULL,6,'','Good Friday, also known as Holy Friday, Black Friday, Great Friday, is a religious holiday observed primarily by Christians commemorating the crucifixion of Jesus Christ and his death at Calvary.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(6,'May Day','',NULL,NULL,6,'','May Day is commemorated in India as the Labour Day which began with the United States Labour Movement on May 1, 1886.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(7,'Buddha Purnima','',NULL,NULL,6,'','Buddha Jayanti or also known as Buddha Purnima is the most sacred festivals of Buddhist. Buddha Purnima (Buddha Birthday) is celebrated in remembrance Lord Buddha. Lord Buddha is the founder of Buddhism. This day is the birth anniversary of Lord Buddha.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(8,'Independence Day','',NULL,NULL,6,'','India\'s Independence Day is celebrated on August 15 to commemorate its independence from British rule and its birth as a sovereign nation on that day in 1947. The day is a national holiday in India.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(9,'Krishna Janmastami','',NULL,NULL,6,'','Krishna Janmashtami , also known as \"Krishnashtami\",\"Saatam Aatham\" ,\"Gokulashtami\", \"Ashtami Rohini\", \"Srikrishna Jayanti\", \"Sree Jayanthi\" or sometimes merely as \"Janmashtami\", is a Hindu festival celebrating the birth of Lord Krishna, an avatar of the Hindu deity Vishnu.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(10,'Id-Ul-Fitr','',NULL,NULL,6,'','Eid al-Fitr often abbreviated to Eid, is a Muslim holiday that marks the end of Ramadan, the Islamic holy month of fasting (sawm).The holiday symbolizes the breaking of the fasting period.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(11,'Ganesh Chaturthi','',NULL,NULL,6,'','Ganesha Chaturthi , also known as Vinayaka Chaturthi, is the Hindu festival of Ganesha. It is the birthday of Lord Ganesha who is widely worshiped as the god of wisdom, prosperity and good fortune.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(12,'Mahatma Gandhi Jayanthi','',NULL,NULL,6,'','Gandhi Jayanti is a national holiday celebrated in India to mark the occasion of the birthday of Mahatma Gandhi, the \"Father of the Nation\". It is celebrated on October 2, every year. It is one of the three official declared National Holidays of India and is observed in all its states and union territories.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(13,'Vijaya Dashami','',NULL,NULL,6,'','Vijayadashami is a festival celebrated in varying forms across Nepal and India. It is celebrated on the tenth day of the bright fortnight (Shukla Paksha) of the Hindu autumn month of Ashvin or Ashwayuja, and is the grand culmination of the 10-day annual Navaratri festival. Vijayadashami is also known as Dasara, Dashahara, Navaratri, and Durgotsav. It is celebrated in the lunar month of Ashwin from the Shukla Paksha Pratipada to the Dashami, or the tenth day of Ashwin.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(14,'Diwali','',NULL,NULL,6,'','Diwali (often written Deepavali) is a significant festival in Hinduism, Sikhism, Buddhism, and Jainism, and an official holiday in India. Adherents of these religions celebrate Diwali as the Festival of Lights. They light diyasâ€”cotton-like string wicks inserted in small clay pots filled with coconut oilâ€”to signify victory of good over the evil within an individual.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(15,'Guru Nanak Jayanthi','',NULL,NULL,6,'','Guru Nanak Jayanti is the birthday of the first Sikh Guru, Guru Nanak, and one of the most sacred festivals in Sikhism. Guru Nanak Dev Ji (the First Guru, the founder of Sikhism) was born on 14 April 1469 in Rai-Bhoi-di Talwandi in the present Shekhupura District of Pakistan, now Nankana Sahib.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(16,'Christmas','',NULL,NULL,6,'','Christmas or Christmas Day is a holiday observed mostly on December 25 to commemorate the birth of Jesus, the central figure of Christianity.','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(17,'New Year\'s Day','',NULL,NULL,6,'','First Day of New Year','2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(18,'Makar Sankranti','',NULL,NULL,NULL,'',NULL,'2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(19,'Pongal','',NULL,NULL,NULL,'',NULL,'2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(20,'Basanta Panchami /Sri Panchami','',NULL,NULL,NULL,'',NULL,'2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(21,'Guru Ravida\'s birthday','',NULL,NULL,NULL,'',NULL,'2012-07-26 18:38:19','0000-00-00 00:00:00',0,1),(22,'Swami Dayananda Saraswati Jayanti','',NULL,NULL,NULL,'',NULL,'2012-07-26 18:38:19','0000-00-00 00